import { useState } from "react";
import "./index.css"
function App(){
    const [data,setData]=useState(null)
    useEffect(()=>{
        fetch("https://reqres.in/api/users")
        .then((res)=>{
            return res.json()
        })
        .then((resp)=>{
            console.log(resp)
            setData(resp.data)
        })
    })
    return(
        <div>
            <h3>Fetch Data From Backend</h3>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Email</th>
                        <th>First_Name</th>
                        <th>Last_Name</th>
                        <th>Avatar</th>                        
                    </tr>
                </thead>
                <tbody>
                    {data?.map((item)=>(

                    
                    <tr>
                        <td>{item.id}</td>
                        <td>{item.email}</td>
                        <td>{item.first_name}</td>
                        <td>{item.last_name}</td>
                        <td>{item.avatar}</td>
                       
                    </tr>
                     ))}
                </tbody>
            </table>
        </div>
    )
}
export default EmpList;
